import React from 'react';
import './App.css';
import Visualizer from './visualizer';

function App() {

  return (
    <div className="App">
      <h1 className="App-h1">
        Sorting Algorithms Visualizer
      </h1>
      <Visualizer/>
    </div>
  );
}

export default App;
